(5523, 33, 0, 1, '別再害羞啦！', '', '2008-02-01 00:00:00', 0000, 0, 1, 4, '我要學會獨立 沒有你還可以\n雖然我知道我不行 聽你的話還要努力\n你說不能給太多 否則我會貪心\n可得到的真的不夠 還想要你的更多 你的更多\n讓我們靠近一些 擁有一切\n                                                                                \n讓我單純地沉浸在 你純粹的呼吸裡\n好不好 不要修飾的形容表達\n讓我安全地棲息在 你掩蓋的無私裡\n好不好 就算是一分鐘也好\n                                                                                \n我要學會麻木 少了你不再哭\n但我還是忍不住 想起你我很在乎\n其實我也懂事 不能那麼任性\n但我還是會沮喪 請你給我一個擁抱 一個擁抱\n讓我們靠近一些 擁有一切\n                                                                                \n讓我單純地沉浸在 你純粹的呼吸裡\n好不好 不要修飾的形容表達\n讓我安全地棲息在 你掩蓋的無私裡\n好不好 就算是一分鐘也好\n                                                                                \n忙碌的 女孩 不能見面的時候\n有想我嗎 說吧 別再害羞了\n                                                                                \n就再給多一點 就再給多一些\n把全部都給我 全部都給我 別再害羞了\n就再給多一點 就再給多一些\n把全部都給我 全部都給我 別再害羞了\n', '', 229, '', 'twice a week', 'twice a week', 'twice a week', '', '', 1, 1, 0, '2008-06-08 01:42:52', '2015-03-12 13:33:01', '0000-00-00 00:00:00'),
(5524, 2049, 0, 1, '另一個夏天', '是寫給政大吉他社48屆的大家!!我愛你們!!', '0000-00-00 00:00:00', 0000, 15, 2, 5, '回想去年的夏天 我們共同的回憶 \r\n\r\n那是湛藍的海水 對流星許的願是否已實現 \r\n\r\n回想去年的夏天 我們共同的信念 \r\n\r\n當時說好要肩並肩 一起走到最後那一天 \r\n\r\n能不能就讓時間 停在這一天 \r\n\r\n雖然我知道 這並不是終點 \r\n\r\n在彼此的心中 我們都明瞭 這只是我們共同的 另一個夏天 \r\n\r\n不知道是哪一天 自己才突然發現 \r\n\r\n一天一點 不知不覺 已習慣有你們在身邊 \r\n\r\n一年365天 天天都要說聲感謝\r\n\r\n在我沮喪悲傷的時候 你們都陪在我身邊 \r\n\r\n(副) \r\n\r\n誰也不許先說再見 誰也不准先掉眼淚 \r\n\r\n因為明天我們誰也不會改變 \r\n\r\n當你感到疲憊 就閉上雙眼 回想從前的每一天 \r\n\r\n(副)(完)', '', 276, '', 'Freshair', 'Freshair', '', '', '', 0, 1, 0, '2008-06-08 12:57:45', '2015-03-12 13:33:01', '0000-00-00 00:00:00'),
