(5692, 152, 690, 1, '謎寐', '', '2008-06-12 00:00:00', 0000, 0, 1, 7, '沉醉在魚肚白晨曦的臉\r\n潮濕氣味讓人難以入寐\r\n無所謂值得留戀不如棧戀\r\n眼前的\r\n\r\n\r\n\r\n匍匐在潮紅的凝脂峰巔\r\n篝火閃爍懸念若隱若現\r\n無所謂值得留戀不如棧戀\r\n眼前的\r\n\r\n\r\n\r\n欣賞吧\r\n花蕾在床沿悄悄綻放\r\n放盪撲鼻花香\r\n鑲在櫻桃耳垂\r\n催打浪濤拍岸\r\n\r\n\r\n\r\n看\r\n覷看我的眼裡的你的眸\r\n謀殺赤裸黎明\r\n明天又在那裡\r\n妳的無邪髮香', '', 226, '', 'IAN', 'Tzara', '', '', '', 0, 0, 1, '2008-06-12 10:20:23', '2013-10-07 17:12:33', '0000-00-00 00:00:00'),
(5693, 152, 690, 2, '純粹自我', '', '2008-06-12 00:00:00', 0000, 0, 1, 7, '社會化過程\r\n遇過太多挫折\r\n忍受再忍受\r\n扼殺著我\r\n \r\n不想去融入\r\n這個共犯結構\r\n拒絕再拒絕\r\n純粹自我\r\n \r\n別擺佈我\r\n別控制我\r\n我有自己的夢\r\n從一開始\r\n你沒真心過\r\n想利用我的\r\n \r\n別擺佈我\r\n別控制我\r\n我有自己的夢\r\n從現在起\r\n我要做自己\r\n自我', '', 266, '', 'IAN', 'Tzara', '', '', '', 0, 0, 1, '2008-06-12 10:30:44', '2013-10-07 17:12:33', '0000-00-00 00:00:00'),
(5694, 152, 690, 3, '選擇消極', '', '2008-06-12 00:00:00', 0000, 0, 1, 7, '選擇寧靜\r\n選擇不芥蒂\r\n選擇直接呼吸這\r\n渾濁空氣\r\n \r\n選擇逃離\r\n選擇不洗滌\r\n選擇專心捕捉\r\n那佝僂身影\r\n \r\n選擇封筆\r\n選擇不抗議\r\n選擇略過閱讀\r\n那斗大標語\r\n \r\n選擇囿己\r\n選擇不治癒\r\n選擇在月曆上\r\n譜四行詩句\r\n \r\n笑我太過消極\r\n積極有何意義\r\n漫談太多主義\r\n如今\r\n我只要無欲\r\n \r\n \r\n選擇無稽\r\n選擇不遮蔽\r\n選擇讓你看輕\r\n我一貧如洗\r\n \r\n選擇耽溺\r\n選擇不釋疑\r\n選擇從此不再\r\n爭什麼真理\r\n \r\n選擇嬉皮\r\n選擇不抗菌\r\n選擇窩在\r\n自己的房間旅行\r\n \r\n選擇安逸\r\n選擇不爭取\r\n選擇可以選擇\r\n是我的權利', '', 265, '', 'IAN', 'Tzara', '', '', '', 0, 0, 1, '2008-06-12 10:35:59', '2013-10-07 17:12:33', '0000-00-00 00:00:00'),
(5695, 152, 690, 4, '壓克力板上的名字', '', '2008-06-12 00:00:00', 0000, 0, 1, 7, '壓克力上的名字\r\n詞曲：Tzara 編曲：FLATCLUB\r\n\r\n\r\n可以忘記了我的名字\r\n在每次你不再需要我的時候\r\n反正痊癒之後拋棄醫生總是病人的權利\r\n可以忘記了我的名字\r\n在妳離開之後\r\n揚長而去的公車背後有我的名字可否注意\r\n\r\n我想我已經習慣\r\n名字擱在壓克力板\r\n\r\n可以忘記了我的名字\r\n在每次你不再需要我的時候\r\n反正痊癒之後拋棄醫生總是病人的權利\r\n可以忘記了我的名字\r\n可以忘記了我\r\n刻意忘記了我\r\n刻意視而不見\r\n\r\n我想我已經習慣\r\n名字擱在壓克力板\r\n\r\n可以忘記了我的名字\r\n在每次你不再需要我的時候\r\n反正痊癒之後拋棄醫生總是病人的權利\r\n可以忘記了我的名字\r\n在妳離開之後\r\n揚長而去的公車背後有我的名字可否注意\r\n\r\n可以忘記了我的名字\r\n可以忘記了我\r\n刻意忘記了我\r\n刻意視而不見\r\n可以忘記了我的名字\r\n可以忘記了我\r\n刻意忘記了我\r\n刻意視而不見\r\n\r\n\r\n\r\n\r\n', '', 206, '', 'Tzara', 'Tzara', '', '', '', 0, 0, 1, '2008-06-12 10:42:45', '2013-10-07 17:12:33', '0000-00-00 00:00:00'),
(5696, 152, 690, 5, '不要假裝', '', '2008-06-12 00:00:00', 0000, 0, 1, 7, '不要假裝\r\n曲：IAN 詞:Tzara 編曲:FLATCLUB\r\n\r\n背著破背包\r\n現在就出發\r\n忘掉狗屁倒灶莫名奇妙的事\r\n\r\n甩掉了公司\r\n甩掉了城市\r\n自由空氣比起冷氣更加舒適\r\n\r\n有同伴也好\r\n一個人也好\r\n一包香煙一罐啤酒天涯海角\r\n\r\n打開玻璃窗\r\n蔚藍海岸線\r\n(我的)公路電影搖滾記事正在上演　\r\n\r\n該怎麼說　該怎麼說\r\n這種放縱的感覺好久沒有\r\n等著你　等著我　前方還有什麼\r\n不去想　不去管　面對鏡頭\r\n不用假裝　大聲合唱　一首沒押韻的歌\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '', 261, '', 'IAN', 'Tzara', '', '', '', 0, 0, 1, '2008-06-12 10:47:22', '2013-10-07 17:12:33', '0000-00-00 00:00:00'),
(5697, 152, 0, 6, 'Roy Rhapsody', '', '0000-00-00 00:00:00', 0000, 15, 1, 7, 'Roy Rhapsody\r\n詞：Roy/Tzara 曲：啟仲/Tzara 編曲:F.L.A.T CLUB\r\n\r\n生活的間隙\r\n夢遺的彌留時刻\r\n純粹的發洩,\r\n唇舌交戰的道別\r\n沒眼神關切\r\n卻只剩閒言閒語\r\n無助、孤單、沮喪\r\n缺乏氧氣的時候,\r\n\r\n他們說日子\r\n一成不變的生活\r\n感到好空虛,\r\n失去活力和熱情 \r\n至少沒意義\r\n但我們還要相信\r\n最後的存在主義\r\n只有絕望的死去\r\n \r\n遇到什麼寄託\r\n救贖\r\n空虛  \r\n都早已不空虛,\r\n人\r\n不過\r\n只奢求一點關心, \r\n好\r\n直接\r\n回過頭\r\n都是為別人而活 \r\n \r\n不想要空虛,\r\n好希望一個玩伴 \r\n有搞頭的伴 \r\n一起瞎攪和的伴\r\n如果能夠只要\r\n陪我玩兩個禮拜\r\n開開心心就好\r\n沒壓力沒有負擔\r\n失溫的時候 \r\n有緩衝器能取暖 \r\n叫我一聲寶貝 \r\n會害臊心跳加快\r\n嬌羞的滋味\r\n一縷緋紅的臉頰\r\n擁抱著旋轉\r\n再繼續無邊幻想\r\n\r\n\r\n回到巴黎蒙馬特 \r\n我是\r\n獨居在\r\n五樓的咖啡店女侍\r\n默默地\r\n行俠仗義,\r\n變成拍壞的大頭照,\r\n尾隨\r\n各大車站,\r\n我要坐在後座把手塞到他的口袋避寒,\r\n他永遠都不知道\r\n \r\n\r\n好想要變成搞頭手裡的\r\n吉他、貝斯、鼓棒、Pick和麥克風,\r\n重金屬强悍厚重猛烈的刷扣\r\n衝擊punch直達心底　LALALALALA\r\n\r\n用最暴力的聲音嘶吼\r\n吶喊摧毀每個不著邊際的角落\r\n我愛搖滾樂手瘋狂失序盡情放縱\r\n用盡全力燃燒一切美好後再見不見\r\n \r\n想要有些戀愛感覺,填滿體內空隙\r\n可以的話\r\n給我一個輕鬆新娘抱 \r\n暖暖胸口 能聽見急促心跳\r\n拉著緩緩滑入緊密的未知黑暗 Shine LALALA…\r\n\r\n只剩下淡淡煙味\r\n \r\n\r\n\r\n', '', 274, '', '啟仲/Tzara ', 'ROY/Tzara', '', '', '', 0, 0, 1, '2008-06-12 10:52:10', '2013-10-07 17:12:33', '0000-00-00 00:00:00'),
(5698, 152, 690, 7, '68 Dogs Day(仙樂隊鼓手版)', '', '2008-06-12 00:00:00', 0000, 0, 1, 7, ' 把臉躺在柏油路面\r\n把斑馬線看成古柯鹼\r\n上膛的彈夾\r\n和Pick項鍊\r\n頑強的舌尖\r\n在琴弦上呻吟詩篇\r\n \r\n赭色的蟑螂也振翅高飛\r\n發霉的猶太麵包教人軟黏\r\n《嘔吐》式存在主義傳染無謂\r\n槍砲、病菌與鋼鐵無止盡永劫回歸\r\n \r\n無政府的狂癲\r\n無神論的妄言\r\n別讓青春的肉體再犧牲浪費\r\n彈孔痕跡能說明一切\r\n \r\n把臉躺在柏油路面\r\n把斑馬線看成古柯鹼\r\n蘇聯坦克終結了那年春天\r\n愛之夏嬉皮少年捧著鮮花嚷著宣言\r\n \r\n於是68年的學運革命場景\r\n缺席的人只能在戲院悼念\r\n藍儂的身影變成件件T-Shirt\r\n蘇維埃的小說冰冷冷地躺在書櫃\r\n \r\n無政府的狂癲\r\n無神論的妄言\r\n別讓青春的肉體再犧牲浪費\r\n針孔痕跡能忘記一切\r\n \r\n \r\nOhh\r\nRight Now\r\nNow\r\nWhatever you shoot\r\nAnd Cheers! Now!\r\nNow\r\nBe swinged away\r\nThe Dogs day\r\n只做愛不作戰\r\n就加入活死人世界多荒謬的謊言\r\n \r\nNow\r\nNow\r\nWhatever you Shout\r\nAnd Cheers! Now!\r\nNow\r\nBe swinged away\r\nThe Dogs day\r\n只做愛不作戰\r\n就吐出氤氳大麻煙圈然後視而不見\r\n', '', 280, '', 'IAN', 'Tzara', '', '', '', 0, 0, 1, '2008-06-12 10:55:39', '2013-10-07 17:12:33', '0000-00-00 00:00:00'),
(5699, 152, 690, 8, 'SAY HELLO!!!', '', '2008-06-12 00:00:00', 0000, 0, 1, 7, '噢\r\n如今你愣在轉角\r\n十一點鍾座標\r\n再不轉向恐怕船就要觸礁\r\n \r\n噢\r\n所以別投鼠忌器\r\n自顧不暇緊張\r\n扭扭捏捏結結巴巴語焉不詳\r\n \r\nSay Hello Honey\r\nSay Hello lovey\r\nSay Hello Baby\r\nSay Hello sweetie\r\n \r\n現在你沒時間考慮面子要往哪掛\r\n看著你的心神不寧舉棋不定的心\r\n越來越無法招架\r\n \r\n(廢話我也不想多嘮叨)\r\n可是你拐彎抹角\r\n面有難色尷尬\r\n欲言又止一點也不瀟灑大方\r\n \r\n噢\r\n還是想懸崖勒馬\r\n矜持不可自拔\r\n眼高手低吞吞吐吐失措慌張\r\n \r\nSay Hello Honey\r\nSay Hello lovey\r\nSay Hello Baby\r\nSay Hello sweetie\r\n \r\n \r\n現在你沒時間考慮面子要往哪掛\r\n看著你的心神不寧舉棋不定的心\r\n越來越無法自拔\r\n \r\n \r\nso\r\n所以你懂嗎\r\n現在的樣子啊\r\n在節骨眼上不計形象的跨\r\n會是最後的贏家\r\nso\r\n所以你懂嗎\r\n現在的樣子啊\r\n在節骨眼上不計形象的跨\r\n就是最後贏家\r\n \r\n \r\n ', '', 316, '', 'Ian&Tzara', 'Tzara ', '', '', '', 0, 0, 1, '2008-06-12 10:59:34', '2013-10-07 17:12:33', '0000-00-00 00:00:00'),
